import React, { Component } from "react";
import CardList from "./CardList";
import { robots } from "./robots";
import SearchBox from "./SearchBox";

class App extends Component {
  constructor() {
    this.state = {
      robots: robots,
      searchfield: "",
    };
  }
  render() {
    return (
      <fragment className="tc">
        <h1>Robofriends</h1>
        <SearchBox />
        <CardList robots={robots} />;
      </fragment>
    );
  }
}

export default App;
